pragma solidity ^0.4.23;

contract Wallet
{
    mapping( address => uint256 ) m_BalanceMap;
    address m_Owner;

    constructor(uint256 initialAmount) public
    {
        m_Owner = msg.sender;
        m_BalanceMap[m_Owner] = initialAmount;
    }

    function balanceOf(address user) public view returns(uint256)
    {
        return m_BalanceMap[user];
    }

    function transfer(address receiver, uint amount) public returns(bool)
    {
        if (m_BalanceMap[msg.sender] < amount) return false;

        m_BalanceMap[msg.sender] -= amount;
        m_BalanceMap[receiver] += amount;

        return true;
    }



}
